    data: |
      SELECT ALL - col0 FROM tab0 (FORMAT parquet) WHERE NOT - 33 * - col2 * - + col1 * - col2 + + ( + ( - - col2 ) ) * + col1 * + col2 + - col2 IS NULL AND NOT ( - col1 ) = NULL;
  - name: tab0

outputs:
  - name: q12647.out
    data: |
